Квест-игра «День студента» 😍

24 января во 2 корпусе прошел квест, посвященный Дню Студента! 

Ребята прошли по 9 этапам 🧩: 
▫️Смешная эстафета;
▫️Поем вместе;
▫️Флешмоб;
▫️Буриме;
▫️Услышь меня;
▫️Актеры;
▫️Викторина «Хочу все знать!»;
▫️Прыжки через скакалку.

После прохождения всех этапов студенты делали групповые фото на улице! 

🌟Спешим озвучить результаты квеста: 
1 место - АФК-21
2 место - АФК-22 
3 место - ФК-11

Поздравляем и благодарим всех участников, организаторов и волонтеров, которые помогали во время проведения квеста! ❤️
